import React from 'react';
import PostCard from './postCard.js';

const PostList = ({result, search, setQuery, setSearch}) => {

    return(
        <div class="flex justify-center flex-wrap mx-100 lg:mx-4">
            <div class="my-1 px-1 w-full md:w-1/2 lg:px-4 lg:w-3/6">
                <PostCard 
                result={search} 
                search={search}
                setQuery={setQuery} 
                setSearch={setSearch}/>

            </div>
        </div>
    );
};

export default PostList;
